import Link from 'next/link';
const Navbar = () => {
  const styles = {
    display: 'flex',
    background: 'grey',
    alignItems: 'space-between'
  };
  return (
    <div style={styles}>
      <Link href="/about">
        <a>About!</a>
      </Link>
      <Link href="/contact">
        <a>Contact Page</a>
      </Link>
      <h1>Our Index Page!!!</h1>
    </div>
  );
};

export default Navbar;
